import React, { useState } from "react";
import CreateClothesModal from "./CreateClothesModal";

const GeneralCreateModal = ({ onClose }) => {
  const [clothesModalOpen, setClothesModalOpen] = useState(false);
  const [outfitModalOpen, setOutfitModalOpen] = useState(false);

  return (
    <>
      {modalOpen && (
        <CreateClothesModal onClose={() => setModalOpenClothes(false)} />
      )}
      <div
        className="fixed left-0 top-0 w-full h-full flex items-center justify-center bg-stone-500/50"
        onClick={onClose}
      >
        <div
          className="rounded-md bg-white p-4 w-lg mb-24"
          onClick={(e) => e.stopPropagation()}
        >
          <div className="flex gap-4">
            <button
              type="button"
              className="text-body bg-neutral-secondary-medium box-border border border-default-medium hover:bg-neutral-tertiary-medium hover:text-heading focus:ring-4 focus:ring-neutral-tertiary shadow-xs font-medium leading-5 rounded-full text-sm px-4 py-2.5 focus:outline-none"
            >
              Create Outfit
            </button>

            <button
              type="button"
              className="text-body bg-neutral-secondary-medium box-border border border-default-medium hover:bg-neutral-tertiary-medium hover:text-heading focus:ring-4 focus:ring-neutral-tertiary shadow-xs font-medium leading-5 rounded-full text-sm px-4 py-2.5 focus:outline-none"
              onClick={() => setModalOpenClothes(true)}
              on
            >
              Create Clothes
            </button>
          </div>
        </div>
      </div>
    </>
  );
};

export default GeneralCreateModal;
